import "antd/dist/antd.css";
import Prototype from "prop-types";
import Head from "next/head";
const NodeBird = ({ Component }) => {
  return (
    <>
      <Head>
        <meta charSet="utf-8" />
        <title>NodeBird</title>
      </Head>
      <Component />
    </>
  );
};
NodeBird.prototype = {
  Component: Prototype.elementType.isRequired,
};
export default NodeBird;
